// App.js
import React from 'react';
import { BrowserRouter ,Router, Route} from 'react-router-dom';
import ContactsView from './Components/ContactsView';
import AddContact from './components/AddContact';
import EditContact from './Components/Edit  Contact';
// import ContactDetails from './components/ContactDetails';
// import SearchContact from './Components/SearchContact';

function App() {
  return (
    <>
    <div>

    <BrowserRouter>
    <Router>
      
        <Route path="/" exact component={ContactsView} />
        <Route path="/add" component={AddContact} />
        <Route path="/edit" component={EditContact} />
        <Route path="/details" component={ContactDetails} />
        {/* <Route path="/search" component={SearchContact} /> */}

      
      
    </Router>
    </BrowserRouter>
    </div>
    </>
  );
}

export default App;
